function bindEditService(){var n=$(".form-table").on("click",".fa-times",function(){1<n.find("tbody tr").length&&$(this).closest("tr").remove()}).on("click",".fa-plus",function(t){t.stopPropagation();t=n.find("tbody");t.append(t.find("tr:last").clone())})}function bindOrder(){$("*[data-action=comment]").on("click",function(t){t.preventDefault();t=prompt("请输入您对本次服务的评分(1-10)","10");postJson($(this).attr("href"),{rank:t})})}